import React, { useState, useEffect, useContext } from 'react';
import axios from 'axios';
import { AuthContext } from '../../context/AuthContext.jsx';

const Billing = () => {
  const { user } = useContext(AuthContext);
  const [bills, setBills] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchBills();
  }, []);

  const fetchBills = async () => {
    try {
      const response = await axios.get('/api/billing', { params: { guestId: user?._id } });
      setBills(response.data.bills);
    } catch (error) {
      console.error('Error fetching bills:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading"><div className="spinner"></div></div>;
  }

  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
        <h1>My Bills</h1>
      </div>

      <div className="card">
        <table className="table">
          <thead>
            <tr>
              <th>Invoice #</th>
              <th>Room Charges</th>
              <th>Services</th>
              <th>Taxes</th>
              <th>Discount</th>
              <th>Total</th>
              <th>Payment Status</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {bills.map(bill => (
              <tr key={bill._id}>
                <td>{bill.invoiceNumber}</td>
                <td>${bill.roomCharges?.toFixed(2)}</td>
                <td>${bill.additionalServices?.reduce((sum, s) => sum + s.totalPrice, 0).toFixed(2)}</td>
                <td>${bill.taxes?.toFixed(2)}</td>
                <td>${bill.discount?.toFixed(2)}</td>
                <td><strong>${bill.totalAmount?.toFixed(2)}</strong></td>
                <td>
                  <span className={`badge ${
                    bill.paymentStatus === 'paid' ? 'badge-success' :
                    bill.paymentStatus === 'partial' ? 'badge-warning' :
                    'badge-danger'
                  }`}>
                    {bill.paymentStatus}
                  </span>
                </td>
                <td>
                  <button
                    className="btn btn-primary"
                    onClick={() => {
                      window.open(`/api/billing/${bill._id}/pdf`, '_blank');
                    }}
                    style={{ padding: '5px 10px', fontSize: '12px' }}
                  >
                    Download PDF
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Billing;
